import React from 'react'
import { SxProps, Theme, Typography } from "@mui/material";
import { useNavigate } from "react-router-dom";

function AddShops() {

  const wholeConShops : SxProps<Theme> = {
    'min-height': '100vh',
  }

  const headerShops : SxProps<Theme> = {
      'display': 'flex',
      'justify-content': 'center',
      'font-family': 'Times New Roman, Times, serif',
      'font-size' : 'x-large',
  }

  const bodyShops : SxProps<Theme> = {
      'display': 'flex',
      'flex-direction': 'row',
      'align-items': 'center',
  }

  const body1 : SxProps<Theme> = {
      'display': 'flex',
      'flex': '1',
  }

  const body2 : SxProps<Theme> = {
      'display': 'flex',
      'flex': '1',
  }

  const buttonShops : SxProps<Theme> = {
      'display': 'flex',
      'justify-content': 'center',
      'align-items': 'center',
      'width': '100px',
      'height': '30px',
      'margin': '0 auto', 
      'margin-top': '1%',
      'background-color': 'burlywood',
  }



  return (
    <div sx = {wholeConShops}>
        <div sx={headerShops}>
            <h2>HERE YOU CAN ADD THE SHOPS</h2>
        </div>
        <div sx={bodyShops}>
            <div sx={body1}><label>ENTER THE SHOP NAME      : </label></div>
            <div sx={body2}><input type='text'></input></div><br/><br/>       
        </div>
        <div className='bodyShops'>
            <div sx={body1}><label>ENTER THE SHOPLOCATION : </label></div>
            <div sx={body2}><input type='text'></input></div><br/><br/>     
        </div>
        <button sx={buttonShops}>ADD SHOP</button>
    </div>
  )
}
export default AddShops
